import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function ListUrheilijat() {
  const [userData, setUrheilijadata] = useState([]);
  useEffect(() => {
    const getUrheilijadata = async () => {
      const reqData = await fetch("http://localhost:3000/urheilijat");
      const resData = await reqData.json();
      setUrheilijadata(resData);
      // console.log(resData);
    };
    getUrheilijadata();
  }, []);

  return (
    <React.Fragment>
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <h5 className="mt-2">User Data</h5>
            <div className="d-grid d-md-flex justify-content-md-end mb-3">
              <Link to="/adduser" className="btn btn-warning">
                Add New User
              </Link>
            </div>
            <table className="table table-bordered table-striped">
              <thead>
                <tr>
                  <th>Sr. No</th>
                  <th>Username</th>
                  <th>Email</th>
                  <th>Phone No</th>
                  <th>Address</th>
                  <th>Status</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {userData.map((userData, index) => (
                  <tr key={index}>
                    <td>{index + 1} </td>
                    <td>{userData.username} </td>
                    <td>{userData.email} </td>
                    <td>{userData.phone} </td>
                    <td>{userData.address} </td>
                    <td>{userData.status === 1 ? "Active" : "Inactive"} </td>
                    <td>
                      <Link
                        to={"/editUser/" + userData.userid}
                        className="btn btn-success mx-2"
                      >
                        Edit
                      </Link>
                      <Link to="/deleteUser" className="btn btn-danger">
                        Delete
                      </Link>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default ListUrheilijat;
